import React from 'react';
import { Navbar } from 'react-bootstrap';


export default function Footer(props) {

    return(
        <Navbar style={{position: 'sticky', bottom: 0}} bg="light" variant="light" fixed="sticky" >
            <Navbar.Collapse className="justify-content-center">
                <p>
                    <a>Icons made by <a href="http://www.dariusdan.com" title="Darius Dan">Darius Dan</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></a><br/>
                    <a target="_blank" href="https://icons8.com/icons/set/user-male-circle">Male User icon</a> icon by <a target="_blank" href="https://icons8.com">Icons8</a>
                </p>
            </Navbar.Collapse>

        </Navbar>
    );
}
